package com.matao.bean;import java.io.Serializable;/** * @author: ZhouYang * @E-mail: ZhouYangGaoGao@163.com * @time:2015-5-4 上午9:52:29 * @Description:TODO */public class Youhui implements Serializable {	private int ProductId;	private int Replys;	private int RecommendPercentage;	private String Title;	private String ImgUrl;	private String AddDate;	private String Mall;	private String Subhead;	private String Url;	private boolean IsExpire;	private boolean IsYes;	@Override	public String toString() {		return "Youhui [ProductId=" + ProductId + ", Replys=" + Replys				+ ", RecommendPercentage=" + RecommendPercentage + ", Title="				+ Title + ", ImgUrl=" + ImgUrl + ", AddDate=" + AddDate				+ ", Mall=" + Mall + ", Subhead=" + Subhead + ", Url=" + Url				+ ", IsExpire=" + IsExpire + ", IsYes=" + IsYes + "]";	}	public int getProductId() {		return ProductId;	}	public void setProductId(int productId) {		ProductId = productId;	}	public int getReplys() {		return Replys;	}	public void setReplys(int replys) {		Replys = replys;	}	public int getRecommendPercentage() {		return RecommendPercentage;	}	public void setRecommendPercentage(int recommendPercentage) {		RecommendPercentage = recommendPercentage;	}	public String getTitle() {		return Title;	}	public void setTitle(String title) {		Title = title;	}	public String getImgUrl() {		return ImgUrl;	}	public void setImgUrl(String imgUrl) {		ImgUrl = imgUrl;	}	public String getAddDate() {		return AddDate;	}	public void setAddDate(String addDate) {		AddDate = addDate;	}	public String getMall() {		return Mall;	}	public void setMall(String mall) {		Mall = mall;	}	public String getSubhead() {		return Subhead;	}	public void setSubhead(String subhead) {		Subhead = subhead;	}	public String getUrl() {		return Url;	}	public void setUrl(String url) {		Url = url;	}	public boolean isIsExpire() {		return IsExpire;	}	public void setIsExpire(boolean isExpire) {		IsExpire = isExpire;	}	public boolean isIsYes() {		return IsYes;	}	public void setIsYes(boolean isYes) {		IsYes = isYes;	}}